import Layout from '../components/Layout';

const HireMe = () => (
    <Layout title="Hire Me">
        <div>
            <p>You can hire me at <a href="mailto:fjemli@niji.fr">fjemli@niji.fr</a></p>
        </div>
    </Layout>
);

export default HireMe;
